const ALPHA = 0.015;

if ( process.argv.length <= 2 ) {
  console.log( "Usage: node " + __filename + " <option>" );
  console.log("Option: info | max | filtered | unfiltered | both");
  process.exit(-1);
}

if (process.argv[2] === 'info') {
  console.log("Data array size", data.data.length);
  console.log("ALPHA", ALPHA);
  process.exit(0);
}

if (process.argv[2] === 'max') {
  let max = 0;
  var maxObj = {};
  data.data.forEach(dp => {
    if (dp.gust > max) {
      max = dp.gust;
      maxObj = dp;
    }
  });

// Results
  console.log("Max Gust", max, maxObj);
  process.exit(0);
}


let gustArray = [];
data.data.forEach(dp => {
  gustArray.push(dp.gust);
});

function lowPass(alpha, value, acc) {
  return (value * alpha) + (acc * (1 - alpha));
}

let filteredGustArray = [];
let acc = 0;
data.data.forEach(dp => {
  acc = lowPass(ALPHA, dp.gust, acc);
  filteredGustArray.push(acc);
});

